import React from "react";
import { signInWithGoogle } from "../firebase"; // your Google sign-in function
import { useNavigate } from "react-router-dom";

export default function LoginPage() {
    const navigate = useNavigate();

    return (
        <div className="login-page">
            <div className="login-container">
                <h1 className="login-title">Welcome to SymbAIosis</h1>
                <p className="login-subtitle">Collaborate and exchange resources seamlessly</p>

                {/* Google sign-in button */}
                <button className="google-button" onClick={signInWithGoogle}>
                    Sign in with Google
                </button>

                <div className="login-footer">
                    <p>
                        New here? <span className="signup-link" onClick={() => navigate("/signup")}>Sign up</span>
                    </p>
                </div>
            </div>
        </div>
    );
}
